import React from 'react';
import { useNavigate } from 'react-router-dom';

const Home = () => {
  const navigate = useNavigate();

  return (
    <div>
      <h1>Welcome to the Home Page</h1>
      <button onClick={() => navigate('/Friend')}>FriendChatBot</button>
      <button onClick={() => navigate('/Coach')}>CoachChatBot</button>
      <button onClick={() => navigate('/Teacher')}>TeacherChatBot</button>
    </div>
  );
};

export default Home;
